import React from 'react'
import '../css/searchbox.style.css'

const Searchbox = () => {
  return (
    <div>
        <div>searchbox</div>
        <div class="search">
            <input type="text" name="" placeholder="Serach" class="text"/>
            <a href="#" class="btn"><i class="fa fa-search "></i></a>
        </div>
    </div>
  )
}

export default Searchbox;
